import navIcon1 from "../assets/img/nav-icon1.svg";
import navIcon2 from "../assets/img/github.svg";
import navIcon3 from "../assets/img/stack-overflow.svg";

export const SocialIcons = ()=>{

    return(
    <div className="social-icon">
        <a href="https://www.linkedin.com/in/sumit-ghewade/"><img src={navIcon1} alt=""/></a>
        <a href="https://github.com/ghewadesumit"><img src={navIcon2} alt=""/></a>
        <a href="#"><img src={navIcon3} alt=""/></a>
    </div>)
}
